import Menu from "../Components/Home/Menu/Menu";
import { useParams } from "react-router-dom";
import { useSelector } from "react-redux";

const MenuPage = () => {
  const { id } = useParams();
  const menus = useSelector((state) => state.menus.menus);

  useEffect(() => {});

  return (
    <>
      <Menu />
    </>
  );
};

export default MenuPage;
